import React, {Component} from 'react';

class ProductEdit extends Component {
    constructor(props) {
        super();
        this.state = {
            id:''
        }
    }

    componentDidMount(){
        const { id } = this.props.match.params;
        console.log(id)
    }

    render(){
        return(
            <div>{this.state.id}</div>
        )
    }
}
export default ProductEdit;
